As the root database user, let's create a new database for a regular, new user. The regular user will be granted all privileges on the new database, including all its tables. Other than granting all privileges , we could limit the user to specific privileges, including: CREATE, DROP, DELETE, INSERT, SELECT, UPDATE, and GRANT OPTION . Such privileges may be called operations or functions, and they allow MySQL users to use and modify the databases, where appropriate. For example, we may want to limit the opacuser user to only be able to use SELECT commands. It totally depends on the purpose of the database and our security risks. From the MySQL query prompt, run the following commands to create a new database opacdb and to grant all privileges to opacdb to the MySQL user opacuser : create database opacdb;
grant all privileges on opacdb.* to 'opacuser'@'localhost';
show databases; Exit out of the MySQL database as the root MySQL user , and then exit out of the root Linux user account , and you should be back to your normal Linux user account: \q And then exit out of the Linux root user account: exit Note: relational database keywords are often written in all capital letters. As far as I know, this is simply a convention to make the code more readable. However, in most cases I'll write the keywords in lower case letters. This is simply because, by convention, I'm super lazy.

