The index.html page will provide a user interface, that is, a form, for entering our bibliographic data. However, the PHP script is needed to communicate and add the data from our form into our MySQL database and books table. Also, just as the HTML form has to match the data structure of the books table, the PHP script also needs to match the form from the HTML page and the data structure in the books table. Here is the PHP script, which I call insert.php : <?php // Load MySQL credentials
require_once '../login.php'; // Establish connection
$conn = mysqli_connect($db_hostname, $db_username, $db_password) or die("Unable to connect"); // Open database
mysqli_select_db($conn, $db_database) or die("Could not open database '$db_database'"); // Prepare and bind SQL statement
$stmt = $conn->prepare("INSERT INTO books (author, title, publisher, copyright) VALUES (?, ?, ?, ?)");
$stmt->bind_param("ssss", $author, $title, $publisher, $copyright); // Set parameters and execute statement
$author = $_POST["author"];
$title = $_POST["title"];
$publisher = $_POST["publisher"];
$copyright = $_POST["copyright"]; if ($stmt->execute() === TRUE) { echo "New record created successfully";
} else { echo "Error: " . $stmt->error;
} // Close statement and connection
$stmt->close();
$conn->close(); echo "<p>Return to the cataloging page: <a href='http://11.111.111.111/cataloging/'>http://11.111.111.111/cataloging/</a></p>";
?>

